import styles from "./ezra.module.css";
import water from "./images/water.png";
import horizon from "./images/horizon.png";
import uncharted from "./images/U4TE.png";
import metalGear from "./images/MGVTPP.png";
import red from "./images/RDR2.png";
import last from "./images/TLOU:P2.png"

function Ezra() {
	return(
		<>
		<div className={styles.firstTop}>
                <img className="" src={red} />
		<h1 className="">I am Ezra.</h1>
                <p className=""> a <span className={styles.pro}>pro</span>grammer.</p>
		<img className="" src={water} />
		</div >
		<div className={styles.firstMiddle}>
		</div >
		<div className={styles.secondMiddle}>
		<h1 className={styles.firstTop}>I am Ezra.</h1>
		<p className={styles.introduce}> a <span className={styles.pro}>pro</span>grammer.</p>
		<img className={styles.wallpaper1} src={horizon} />
		<img className={styles.wallpaper2} src={uncharted} />
		<img className={styles.wallpaper3} src={metalGear} />
		<img className={styles.wallpaper5} src={last} />

		</div>
		</>
	);
};

export default Ezra;
